# GonnectError
# We want to define each variant as a nested class that's also a subclass,
# which is tricky in Python.  To accomplish this we're going to create each
# class separately, then manually add the child classes to the base class's
# __dict__.  All of this happens in dummy class to avoid polluting the module
# namespace.
class GonnectError(Exception):
    pass

_UniffiTempGonnectError = GonnectError

class GonnectError:  # type: ignore
    
    class ParseError(_UniffiTempGonnectError):
        
        def __init__(self, message):
            super().__init__(", ".join([
                "message={!r}".format(message),
            ]))
            self.message = message

        def __repr__(self):
            return "GonnectError.ParseError({})".format(str(self))
    _UniffiTempGonnectError.ParseError = ParseError # type: ignore
    class QueryError(_UniffiTempGonnectError):
        
        def __init__(self, message):
            super().__init__(", ".join([
                "message={!r}".format(message),
            ]))
            self.message = message

        def __repr__(self):
            return "GonnectError.QueryError({})".format(str(self))
    _UniffiTempGonnectError.QueryError = QueryError # type: ignore
    class IoError(_UniffiTempGonnectError):
        
        def __init__(self, message):
            super().__init__(", ".join([
                "message={!r}".format(message),
            ]))
            self.message = message

        def __repr__(self):
            return "GonnectError.IoError({})".format(str(self))
    _UniffiTempGonnectError.IoError = IoError # type: ignore
    class InvalidInput(_UniffiTempGonnectError):
        
        def __init__(self, message):
            super().__init__(", ".join([
                "message={!r}".format(message),
            ]))
            self.message = message

        def __repr__(self):
            return "GonnectError.InvalidInput({})".format(str(self))
    _UniffiTempGonnectError.InvalidInput = InvalidInput # type: ignore

GonnectError = _UniffiTempGonnectError # type: ignore
del _UniffiTempGonnectError


class _UniffiFfiConverterTypeGonnectError(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return GonnectError.ParseError(
                _UniffiFfiConverterString.read(buf),
            )
        if variant == 2:
            return GonnectError.QueryError(
                _UniffiFfiConverterString.read(buf),
            )
        if variant == 3:
            return GonnectError.IoError(
                _UniffiFfiConverterString.read(buf),
            )
        if variant == 4:
            return GonnectError.InvalidInput(
                _UniffiFfiConverterString.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def check_lower(value):
        if isinstance(value, GonnectError.ParseError):
            _UniffiFfiConverterString.check_lower(value.message)
            return
        if isinstance(value, GonnectError.QueryError):
            _UniffiFfiConverterString.check_lower(value.message)
            return
        if isinstance(value, GonnectError.IoError):
            _UniffiFfiConverterString.check_lower(value.message)
            return
        if isinstance(value, GonnectError.InvalidInput):
            _UniffiFfiConverterString.check_lower(value.message)
            return

    @staticmethod
    def write(value, buf):
        if isinstance(value, GonnectError.ParseError):
            buf.write_i32(1)
            _UniffiFfiConverterString.write(value.message, buf)
        if isinstance(value, GonnectError.QueryError):
            buf.write_i32(2)
            _UniffiFfiConverterString.write(value.message, buf)
        if isinstance(value, GonnectError.IoError):
            buf.write_i32(3)
            _UniffiFfiConverterString.write(value.message, buf)
        if isinstance(value, GonnectError.InvalidInput):
            buf.write_i32(4)
            _UniffiFfiConverterString.write(value.message, buf)

