class _UniffiFfiConverterTypeGraphDB:
    @staticmethod
    def lift(value: int) -> GraphDb:
        return GraphDb._uniffi_make_instance(value)

    @staticmethod
    def check_lower(value: GraphDb):
        if not isinstance(value, GraphDb):
            raise TypeError("Expected GraphDb instance, {} found".format(type(value).__name__))

    @staticmethod
    def lower(value: GraphDb) -> ctypes.c_uint64:
        return value._uniffi_clone_handle()

    @classmethod
    def read(cls, buf: _UniffiRustBuffer) -> GraphDb:
        ptr = buf.read_u64()
        if ptr == 0:
            raise InternalError("Raw handle value was null")
        return cls.lift(ptr)

    @classmethod
    def write(cls, value: GraphDb, buf: _UniffiRustBuffer):
        buf.write_u64(cls.lower(value))

class _UniffiFfiConverterUInt8(_UniffiConverterPrimitiveInt):
    CLASS_NAME = "u8"
    VALUE_MIN = 0
    VALUE_MAX = 2**8

    @staticmethod
    def read(buf):
        return buf.read_u8()

    @staticmethod
    def write(value, buf):
        buf.write_u8(value)
